import sys
import base64
from PIL import Image

src = """
data:image/jpeg;base64,
"""
if __name__ == '__main__':
    data = src.split(',')[1]
    image_data = base64.b64decode(data)
    with open('PayQRCode.jpeg', 'wb') as f:
        f.write(image_data)
    img = Image.open('PayQRCode.jpeg')
    img.show()